import{_ as e,o as r,c as t,O as a}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 20-88.75 Effect of registration for modification.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/20-88.75.md","filePath":"vacode/20-88.75.md"}'),o={name:"vacode/20-88.75.md"},i=a('<h1 id="§-20-88-75-effect-of-registration-for-modification" tabindex="-1">§ 20-88.75 Effect of registration for modification. <a class="header-anchor" href="#§-20-88-75-effect-of-registration-for-modification" aria-label="Permalink to &quot;§ 20-88.75 Effect of registration for modification.&quot;">​</a></h1><p>A tribunal of the Commonwealth may enforce a child support order of another state, registered for purposes of modification, in the same manner as if the order had been issued by a tribunal of the Commonwealth, but the registered support order may be modified only if the requirements of § <a href="http://law.lis.virginia.gov/vacode/20-88.76/" target="_blank" rel="noreferrer">20-88.76</a> or <a href="http://law.lis.virginia.gov/vacode/20-88.77:1/" target="_blank" rel="noreferrer">20-88.77:1</a> have been met.</p><p>1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0673" target="_blank" rel="noreferrer">673</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0754" target="_blank" rel="noreferrer">754</a>; 2015, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0727" target="_blank" rel="noreferrer">727</a>.</p>',3),n=[i];function f(c,s,l,d,_,h){return r(),t("div",null,n)}const m=e(o,[["render",f]]);export{p as __pageData,m as default};
